        <script>
            /**
             * @param {string} ransomNote
             * @param {string} magazine
             * @return {boolean}
             * map 时间复杂度O(n), 空间复杂度O(n)
             */
            var canConstruct = function (ransomNote, magazine) {
                if (magazine.length < ransomNote.length) {
                    return false;
                }
                let ranMap = new Map();
                let magMap = new Map();
                for (let char of ransomNote) {
                    if (ranMap.has(char)) {
                        ranMap.set(char, ranMap.get(char) + 1);
                    } else {
                        ranMap.set(char, 1);
                    }
                }
                for (let char of magazine) {
                    if (magMap.has(char)) {
                        magMap.set(char, magMap.get(char) + 1);
                    } else {
                        magMap.set(char, 1);
                    }
                }
                for (const key of ranMap.keys()) {
                    if (ranMap.get(key) > magMap.get(key) || !magMap.get(key)) {
                        return false;
                    }
                }
                return true;
            };
